script: |
  super -f text -I q5536.spq | sort > q5536.out

inputs:
  - name: q5536.spq
    data: |
      SELECT DISTINCT + col2 / col2 AS col0 FROM tab0 (FORMAT parquet) WHERE ( - tab0.col1 ) NOT IN ( col0 + - col0 - tab0.col2 / col0 );
  - name: tab0

outputs:
  - name: q5536.out
    data: |
      1
